import takiacademy from "../images/takiacademy.png";

const Numbers = () => {
  return (
    <section className="numbers">
      <div className="title">أرقام</div>
      <div className="description">
        تقي أكاديمي هي أوّل منصّة تعليميّة عبر الانترنت في تونس (منذ 2013) موجهة
        لتلامذة الابتدائي، الأساسي و الثانوي..
      </div>

      <div className="content">
        <div className="cards"></div>
        <div className="image">
          <img src={takiacademy} />
        </div>
      </div>
    </section>
  );
};

export default Numbers;
